import React from 'react';
import LogoNumeroUno from './Images/Cocktail-icon.png';

const Header = (props) => {
	return (
		<div className="image-container">
			<img src={LogoNumeroUno} alt="LogoNumeroUno" height="64px" width="64px" />
			<div className="text-over-image-right">Numero Uno</div>
			<div className="text-over-image-right">Numero Uno</div>
		</div>
	);
};

export default Header;
